tables.table_schema:
CREATE TABLE table1 (
    id SERIAL PRIMARY KEY,
    name VARCHAR(255),
    value INTEGER
);

CREATE TABLE table2 (
    id SERIAL PRIMARY KEY,
    category VARCHAR(100),
    quantity INTEGER
);

CREATE TABLE VisualizationData (
    id INT PRIMARY KEY,
    date DATE,
    value FLOAT
);

CREATE TABLE VisualizationConfig (
    config_id INT PRIMARY KEY,
    visualization_type VARCHAR(50),
    visualization_name VARCHAR(50)
);

CREATE TABLE VisualizationMetadata (
    metadata_id INT PRIMARY KEY,
    visualization_id INT,
    description TEXT
);

CREATE TABLE visualization_data (
    id INT PRIMARY KEY,
    data_name TEXT,
    data_value DECIMAL
);

CREATE TABLE visualization_metadata (
    metadata_id INT PRIMARY KEY,
    visualization_id INT,
    metadata_key TEXT,
    metadata_value TEXT
);

CREATE TABLE visualization_metrics (
    metric_id INT PRIMARY KEY,
    visualization_id INT,
    metric_name TEXT,
    metric_value DECIMAL
);

CREATE TABLE visualization_logs (
    log_id INT PRIMARY KEY,
    visualization_id INT,
    log_timestamp TIMESTAMP,
    log_message TEXT
);
